import './App.css';
import axios from 'axios';
// import CharacterList from './components/Characters';
import BB from './components/BB';
import BCS from './components/BCS';
import Image from './components/SerieImage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const [BBList, setBBList] = useState([])
    useEffect(() => {
        axios
            .get('https://tarea-1-breaking-bad.herokuapp.com/api/episodes?series=Breaking+Bad')
            .then(response => {
                setBBList(response.data);
            })
            .catch(err => {
                console.log(err)
            })
    }, [])

function App() {
  return (
    <Router>
      <div className="App">
        <Link to='/' className="link-inicio">
          <h1 className='div-inicio'> Tarea 1 </h1>
        </Link>
        <hr />
        <Switch>
          <Route path="/home">
            <div className="row">
              <div className="column">
                < Image nom={'bb'} />
                < BBList />
              </div>
              <div className="column">
                < Image nom={'bcs'} />
                < BCSList />
              </div>
            </div>
          </Route>
          <Route path={"/breaking-bad/temporada/:id"}>
            <div>
              <h1>Hola</h1>
            </div>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
